import React, {Component} from 'react';
import './OnlineConsultation.css'
import SubTitle from "../SubTitle/SubTitle";
import SimpleText from "../SimpleText/SimpleText";
import OnlineConsultationImage from '../../assets/solo-image.jpg'

function OnlineConsultation(props) {
    const onlineTitleText='Онлайн консультації';
    const onlineConsultationText = 'Психотерапевт онлайн - це працює?\n' +
        'Так, це працює краще, ніж взагалі не брати консультацію психотерапевта. Я приймаю онлайн, коли клієнт знаходиться не в Києві, або коли поза Києвом перебуваю я. Під час карантину, більшість консультацій проходити онлайн. Я приймаю по скайпу або іншому месенджер. Так само, терапія онлайн допомагає якщо з якоїсь причини ви не можете залишати свій будинок (в разі карантину, соціальної тривоги, фізичної травми). Також є ті, постійно в роз\'їздах, для них онлайн-психотерапія терапія теж краще, ніж нічого.';
    const onlineConsultationStyle = {
        padding: '0 50px 0 50px'
    };
    return (
            <div className="online-consultation-container">
                <SubTitle text={onlineTitleText}/>
                <div className="online-consultation__inner">
                    <SimpleText style={onlineConsultationStyle} text={onlineConsultationText}/>
                    <img
                        src={OnlineConsultationImage}
                        height="400px"
                        width="100%"
                        alt="background"
                    />
                </div>
            </div>
        );
}

export default OnlineConsultation;
